export class Model{
    items;

    constructor(){
        this.items=[
                new TodoItem("Kahvaltı",true),
                new TodoItem("Kod",false),
                new TodoItem("Gitar",false),
                new TodoItem("Ders",false),
        ];
    }
}

export class TodoItem{
    description;
    action;

    constructor(description,action){
        this.description=description;
        this.action=action;
    };
}
